import React from 'react'
import Card from 'react-bootstrap/Card';

 const TodoItem = (props) => {
	return (
		<Card className="m-3 p-3">
			<Card.Header className="d-flex justify-content-between">
				<div>
					<span className="todo__item__id"> {props.data.id} </span>
					<span> {props.data.title} </span>
				</div>
			</Card.Header>
			<div className="todo__item__content">
				<div className="todo__item__title">

				</div>
				<div className="todo__item__text"> {props.data.text} </div>
			</div>
			<button className="todo__item__btn"> delete</button>
		</Card>
	);
};

export default TodoItem
